svg.script:
  
  	var obcregion;
	var objregion;
	var obc;
	var t;
	window.onSVGLoad=initLater();
	function initLater() {
     	//this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
     	window.setTimeout("init()",0);
    }
	function init() {
		
		var target=document.getElementById("ztline");
		var child = target.firstChild;
		while (child != null) {
				child.addEventListener("mouseover", Highlight, false);
				child.addEventListener("mouseout", HighlightRecover, false);	
				child.addEventListener("click", showregion,false);
				child = child.nextSibling;
			}
	}
	
	function Highlight(evt) {
			var obj = evt.target;
			obc=obj.getAttributeNS(null,"class");
	        obj.setAttributeNS(null,"class", "fil200 str50");
	}

	function HighlightRecover(evt) {
			var obj = evt.target;		
			obj.class=obc;
			obj.setAttributeNS(null,"class", obc);
	}
	function showregion(evt){	
	
		var obj = evt.target;
		obd=obj.id;
		objregion = document.getElementById(obd+1);
		obcregion = objregion.getAttribute("class")||objregion.className;
		objregion.setAttribute("class","str200 fil50");
		t=objregion;
		setTimeout("regionrecover()", 3000 );
		
		//setTimeout("objregion.setAttribute("class",obcregion)",1000)
		}
		
	function regionrecover(){
	
		t.setAttribute("class",obcregion);
		
	}
	   function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style", "visibility: hidden"); 
	}
